import React from 'react';
import Card from '../components/Card'

const CardContainer = () => {

    const states = useSelector(reducer => reducer.objectiveState)

    return(
        <div id='toy-collection'>
            {states.objectives.map(objective => <Card objective = {objective}/>)}
        </div>
    )
}
